To find the matrix that corresponds to reflecting over a vector, we first need to normalize the vector. The normalized vector is obtained by dividing the vector by its magnitude.

The given vector is \begin{pmatrix} -1 \\ 3 \end{pmatrix}.

The magnitude of the vector is given by:

\[
\sqrt{(-1)^2 + (3)^2} = \sqrt{1 + 9} = \sqrt{10}
\]

So, the normalized vector is:

\[
\frac{1}{\sqrt{10}} \begin{pmatrix} -1 \\ 3 \end{pmatrix} = \begin{pmatrix} -\frac{1}{\sqrt{10}} \\ \frac{3}{\sqrt{10}} \end{pmatrix}
\]

Now, we can find the reflection matrix. The reflection matrix is given by:

\[
\begin{pmatrix}
2(v_xv_x') - v_x'^2 & 2(v_xv_y') - v_y'v_x \\
2(v_y'v_x') - v_y'^2 & 2(v_yv_y') - v_y'^2
\end{pmatrix}
\]

where \((v_x, v_y)\) is the normalized vector and \((v_x', v_y')\) is its transpose.

Substituting the values, we get:

\[
\begin{pmatrix}
2(-\frac{1}{\sqrt{10}})(-\frac{1}{\sqrt{10}}) - (\frac{3}{\sqrt{10}})^2 & 2(-\frac{1}{\sqrt{10}})\frac{3}{\sqrt{10}} - (\frac{3}{\sqrt{10}})^2 \\
2(\frac{3}{\sqrt{10}})(-\frac{1}{\sqrt{10}}) - (\frac{3}{\sqrt{10}})^2 & 2(\frac{3}{\sqrt{10}})\frac{3}{\sqrt{10}} - (\frac{3}{\sqrt{10}})^2
\end{pmatrix}
\]

Simplifying, we get:

\[
\begin{pmatrix}
\frac{2}{10} - \frac{9}{10} & -\frac{6}{10\sqrt{10}} - \frac{9}{10} \\
-\frac{6}{10\sqrt{10}} - \frac{9}{10} & \frac{18}{10\sqrt{10}} - \frac{9}{10}
\end{pmatrix}
\]

Further simplifying, we get:

\[
\begin{pmatrix}
-\frac{7}{10} & -\frac{15}{10\sqrt{10}} \\
-\frac{15}{10\sqrt{10}} & \frac{9}{10\sqrt{10}}
\end{pmatrix}
\]

So, the matrix that corresponds to reflecting over the vector \begin{pmatrix} -1 \\ 3 \end{pmatrix} is:

\[
\begin{pmatrix}
-\frac{7}{10} & -\frac{15}{10\sqrt{10}} \\
-\frac{15}{10\sqrt{10}} & \frac{9}{10\sqrt{10}}
\end{pmatrix}
\]

This is the reflection matrix.
